import { React, useState } from "react";
import PageHeader from "../components/PageHeader";

export default function ContactPage() {
    const titleText = "Contact";
    const subTitleText = "";

    const [text, setText] = useState('');

    const inputHandler = (event) => {
        setText(event.target.value);
      };

      const copy = async () => {
        await navigator.clipboard.writeText(text);
        alert('Text copied');
      };

    const styles = {
        container: {
          margin: '10%',
        },
      };


    return (
        <div>
            <PageHeader title={ titleText } subtitle={ subTitleText }/>
            <div>
      <input type="text" value={text} onChange={inputHandler} />
      <button onClick={copy} disabled={!text}>
        Copy To Clipboard
      </button>
    </div>

            <div className="row contact-body py-4 justify-content-center">
                <div className="col-8">
                    <ul className="contact-list" style={{ listStyleType: 'none', textAlign: 'left' }}>
                        <li className="contact-item py-2">
                            <h3>National Nonprofit:</h3>
                        </li>
                        <li className="contact-item py-2">
                            <h3>Penn Chapter:</h3>
                        </li>
                        <li className="contact-item py-2">
                            <h3>Penn Chapter Executive Board:</h3>
                        </li>
                        <li className="contact-item py-2">
                            <h3>Penn Chapter Committee Contacts</h3>
                            <ul className="committee-contacts" style={{ textAlign: 'left' }}>
                                <li className="committee-item">
                                    <h5>Content: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Event Planning: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Marketing & Design: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Finance: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Growth: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Affairs: </h5>
                                </li>
                                <li className="committee-item">
                                    <h5>Web/Tech & Analytics: </h5>
                                </li>
                            </ul>
                        </li>
                        <li className="contact-item py-2">
                            <h5>You can also reach out individually to a member of our chapter's leadership here</h5>
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    );
}
